import { FuseLoadable } from "owp/@fuse";

export const C0205000Config = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes  : [
        {
            path     : '/pages/C0205000',
            component: FuseLoadable({
                loader: () => import('./C0205000')
            })
        },
        {
            path     : '/pages/C0205000_01',
            component: FuseLoadable({
                loader: () => import('./C0205000_01')
            })
        }
    ]
};
